import React from 'react';
import { Grid, Box } from 'theme-ui'
import './App.css';
import spacings from './spacings.json'

function App() {
  console.log(spacings);

  const sites = Object.keys(spacings).filter(site => spacings[site].length);



  return (
    <div className="App">
      <Grid gap={2} columns={2}>
        {sites.map((site) => {
          const siteSpacing = spacings[site].filter(s => s > 0);
          const min = siteSpacing[0];
          const max = siteSpacing[siteSpacing.length - 1];
          return (
            <Box key={site}>
              {site}
              <div>
                <svg width="100%" viewbox="">
                  <rect width={min} height="25px" fill="#000" fill />
                  <rect width={max} height="25px" />
                </svg>
              </div>
            </Box>
          )
        })}
      </Grid>



    </div>
  );
}

export default App;
